import React, { useEffect, useState } from "react";
import axios from "axios";

const Mid = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      const options = {
        method: 'GET',
        url: 'https://airbnb-data.p.rapidapi.com/WebAPIs/airbnb/category/v1',
        headers: {
          'X-RapidAPI-Key': 'c0ae563f37mshd4b90cc967d0f2bp1071f8jsnae849873a031',
          'X-RapidAPI-Host': 'airbnb-data.p.rapidapi.com'
        }
      };
      
     try {
	const response = await axios.request(options);
	console.log(response.data);
} catch (error) {
	console.error(error);
}
    };

    fetchData();
  }, []);

  if (loading) {
    return <p>Loading...</p>; // Display loading message
  }

  if (error) {
    return <p>Error: {error.message}</p>; // Display error message
  }

  return (
    <div style={{ paddingTop:"40px",paddingBottom:"40px"}}>
      <h2>Inspiration for future getaways</h2>
      <div style={{ display: "flex", gap: "30px", marginBottom: "20px" }}>
        <div>Popular</div>
        <div>Art & Culture</div>
        <div>Outdoors</div>
        <div>Mountains</div>
        <div>Beach</div>
        <div>Unique Stays</div>
        <div>Categories</div>
        <div>Things To Do</div>
      </div>
      <div>
        {data.length > 0 ? (
          <ul>
            {data.map((item, index) => (
              <li key={index}>{item.name}</li>
            ))}
          </ul>
        ) : (
          <div></div>
        )}
      </div>
    </div>
  );
};

export default Mid;
